import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Image from 'react-bootstrap/Image'; // Import the Image component
import image1 from '../assets/image1.png';
import image3 from '../assets/image3.png';

function Slides() {
  return (
    <Carousel>
      <Carousel.Item>
        {/* Use Image component with the source of your first image */}
        <Image src={image1} alt="First slide" fluid />
        <Carousel.Caption>
          <h3>First slide label</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        {/* Use Image component with the source of your second image */}
        <Image src={image3} alt="Second slide" fluid />
        <Carousel.Caption>
          <h3>Second slide label</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default Slides;
